import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import TableCell   from '@material-ui/core/TableCell';
import CanvasGraph from './CanvasGraphComponent';

const styles = theme => ({
    pointer: {
	cursor:"pointer",
	width:"100%",
	height:"100%",
	padding: theme.spacing.unit*0,
    },
    nopointer: {
	width:"100%",
	height:"100%",
	padding: theme.spacing.unit*0,
    },
});
function SeriesCell(props) {
    const { classes,state,onclick,title,elements,...other } = props;
    var cnt=0;
    var lev=-1;
    var elen=elements.length;
    for (var ee=0;ee<elen;ee++) {
        cnt=cnt+elements[ee].cnt;
        lev=Math.max(lev,elements[ee].lev);
    }; 
    var cursor=classes.nopointer;
    if (onclick !== undefined) {
	cursor=classes.pointer;
    }
    // var bgcolor=state.Colors.getLevelColor(lev);
    // bgcolor={bgcolor} 
    return(
	    <TableCell className={cursor} onClick={onclick} title={title} width={100}>
  	    <CanvasGraph {...other} className={cursor} cursor={cursor} classes={classes} state={state} 
	                            onclick={onclick} title={title} elements={elements}/>  
	    </TableCell>
    );
}

SeriesCell.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(SeriesCell);
